''' 
    짧은 리스트에서 빠른 순서 : 4 -> 5 -> 1 -> 3 -> 2
      긴 리스트에서 빠른 순서 : 5 -> 4 -> 2 -> 1 -> 3
 중복 많고 긴 리스트 빠른 순서 : 5 -> 4 -> 1 -> 2 -> 3

twoSum1 : 중복되는 숫자를 제외하고 만든 리스트 생성. 해당 리스트를 2개씩 골라 만든 조합(itertools.combinations())으로 합이 target인 조합 찾음.
twoSum2 : twoSum1에서 조합 대신 (target - numbers[i])의 값이 있는지 찾아 확인
twoSum2_1 : twoSum2에서 리스트 내의 숫자를 찾는 방법으로 index대신 in 사용( 리스트의 크기가 작을 때 속도 개선되나, 리스트 길이가 길어지면 twoSum2와 비슷한 속도 )
twoSum3 : twoSum2에서 중복되는 숫자를 만드는 리스트 생성시 filter사용( filter함수에 의해 리스트 개수가 많아질 경우 매우 느려짐 )
twoSum4 : 중복되는 숫자를 제외하는 리스트 생성하지 않고 바로 target - numbers[i]값이 있는지 찾아 확인.
twoSum5 : twoSum4에서 중복되는 숫자일 경우 그냥 넘어가도록 조건문 추가

twoSum5 에서는 시간복잡도가 O(N)인데, 중복되는 숫자를 넘어가는 방법으로 이진탐색을 사용한다면 k*log(N)의 시간복잡도를 가진 더 빠른 함수 만들 수 있을 것으로 예상.
'''

from itertools import combinations

class Solution:
    def twoSum1(self, numbers, target):
        answer = []
        t = numbers[:2]
        for idx in range(2, len(numbers)):
            if t[-1] != t[-2] or t[-1] != numbers[idx]:
                t.append(numbers[idx])

        for i in combinations(t, 2):
            if sum(i) == target:
                answer.append(numbers.index(i[0])+1)
                if i[0] == i[1]:
                    numbers[numbers.index(i[0])] = 'already use'
                answer.append(numbers.index(i[1])+1)
                return answer


    def twoSum2(self, numbers, target):
        answer = []
        t = numbers[:2]
        for idx in range(2, len(numbers)):
            if t[-1] != t[-2] or t[-1] != numbers[idx]:
                t.append(numbers[idx])

        for i, n in enumerate(t):
            f_num = target - n
            try:
                t.index(f_num)
                answer.append(numbers.index(n)+1)
                if numbers.index(n) == numbers.index(f_num):
                    numbers[i] = 'already use'
                answer.append(numbers.index(f_num)+1)
                return answer
            except:
                pass

    def twoSum2_1(self, numbers, target):
        answer = []
        t = numbers[:2]
        for idx in range(2, len(numbers)):
            if t[-1] != t[-2] or t[-1] != numbers[idx]:
                t.append(numbers[idx])

        for i, n in enumerate(t):
            f_num = target - n
            if f_num in t:
                answer.append(numbers.index(n)+1)
                if numbers.index(n) == numbers.index(f_num):
                    numbers[i] = 'already use'
                answer.append(numbers.index(f_num)+1)
                return answer

    def twoSum3(self, numbers, target):
        answer = []
        pass_cnt = 0
        t = []
        for i in range(len(numbers)):
            try:
                if numbers[i+pass_cnt] == numbers[i+pass_cnt+1]:
                    t.append(numbers[i+pass_cnt])
                    t.append(numbers[i+pass_cnt])
                    dupl_list = list(filter(lambda x:numbers[x]==0, range(len(numbers))))
                    
                    pass_cnt += len(dupl_list)-1
                else:
                    t.append(numbers[i+pass_cnt])
            except:
                pass

        for i, n in enumerate(t):
            f_num = target - n
            try:
                t.index(f_num)
                answer.append(numbers.index(n)+1)
                if numbers.index(n) == numbers.index(f_num):
                    numbers[i] = 'already use'
                answer.append(numbers.index(f_num)+1)
                return answer
            except:
                pass


    def twoSum4(self, numbers, target):
        d = {}
        # O(N)
        for i in range(len(numbers)):
            remain = target - numbers[i]
            if remain in d:
                return [d[remain] + 1, i + 1]
            d[numbers[i]] = i
        return None

    

    def twoSum5(self, numbers, target):
        d = {}
        for i in range(len(numbers)):
            try:
                if numbers[i] == numbers[i+1]:
                    continue
            except:
                pass
            remain = target - numbers[i]
            
            if remain in d:         
                return [d[remain] + 1, i + 1]
            d[numbers[i]] = i
        return None


